<!DOCTYPE html>
<html lang="zh">
<head>
  <meta charset="UTF-8">
  <title>interview</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="Description">
  <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0">
  <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/docsify@4/lib/themes/vue.css">
  <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/docsify-sidebar-collapse/dist/sidebar.min.css" />
  <link rel="icon" href="https://kinvy-images.oss-cn-beijing.aliyuncs.com/res/emoji-book.png">
  <link
  rel="stylesheet"
  href="//cdn.jsdelivr.net/npm/docsify-dark-mode@latest/dist/style.min.css"
/>
</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
      name: 'interview',
      repo: ' https://github.com/Kinvy66/interview',
      maxLevel: 3,
      // loadNavbar: true,
      mergeNavbar: true,
      loadSidebar: true,
      search: {
            paths: 'auto',
            placeholder: 'üîç Type to search ',
            noData: 'üòû No Results! ',
            depth: 6
      },
      copyCode: {
            buttonText: 'Copy to clipboard',
            errorText: 'Error',
            successText: 'Copied',
      },
    }
  </script>
  <!-- Docsify v4 -->
  <script src="//unpkg.com/docsify/lib/docsify.min.js"></script>
  <!-- plugins -->
  <script src="//unpkg.com/docsify/lib/plugins/search.js"></script>
  <script src="//unpkg.com/docsify/lib/plugins/zoom-image.js"></script>
  <script src="//unpkg.com/prismjs/components/prism-c.js"></script>
  <script src="//unpkg.com/prismjs/components/prism-cpp.js"></script>
  <script src="//cdn.jsdelivr.net/npm/docsify-sidebar-collapse/dist/docsify-sidebar-collapse.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/docsify-terminal-block@1.0.3"></script>
  <script src="https://unpkg.com/docsify-copy-code@2"></script>
</body>
</html>
